import React from 'react'
import './Alert.css'

function Alert(props) {
    return ( 
        <div className='alert' style={{display:props.display}}>
            <div className='alert-1'>
                <h2>{props.head}</h2>
                <p>{props.text}</p>
                <div>
                    <button>Ok</button>
                </div>
            </div>
        </div>
    )
}
export default Alert;
